function(el, x, data) {
  return (
    function(el, x) {
      var updateLegend = function () {
          var selectedGroup = document.querySelectorAll('input:checked')[0].nextSibling.innerText.substr(1);

          //document.querySelectorAll('.legend').forEach(a => a.hidden=true);
          //document.querySelectorAll('.legend').forEach(l => {
          document.querySelectorAll('div.info.legend.leaflet-control').forEach(a => a.hidden=true);
          document.querySelectorAll('div.info.legend.leaflet-control').forEach(l => {;
            if (l.children[0].children[0].innerText == 'Active cases (municipality)' & selectedGroup == 'Municipality') l.hidden=false;
            if (l.children[0].children[0].innerText == 'Active cases (LGA)' & selectedGroup == 'Local geographic area') l.hidden=false;

          });
      };

      $("a[href='#geospatial']").on('shown.bs.tab', function(e) {


      updateLegend();

      });

      this.on('baselayerchange', e => updateLegend());
    }).call(this.getMap(), el, x, data);
}
